For anyone watching the @wser livestream this weekend during the final minutes of the race, this moment collectively broke our hearts. Ash Bartholomew, also known as “Lucy’s dad”, finished the race a heartbreaking TWO minutes over the 30 hour cutoff, unable to even run upright anymore as he gave everything he had to cross that finish line. I wrote some words about his finish on the @wser page, if you want to check that out. This image of Ash sitting down after crossing the finish line and staring down at his watch, with the battery fully drained, particularly spoke to me. There are so few moments in life when we truly drain the tank and leave everything out there, and even when that doesn’t work out perfectly or we don’t get the result we were looking for, it’s still something to be incredibly proud of. It’s brave to be that vulnerable, and it’s a beautiful way to live life.

@lucy_bartholomew I hope your dad can feel just how much everyone is proud of him. He won in our books, buckle be damned.

Side note, if you want to see his finish, it’s all recorded on YouTube on the livestream, which my amazing hubby @billyyang worked so hard to produce this weekend. youtube.com/@wser100
